// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import About from './pages/About';
import Login from './pages/Login';
import Register from './pages/Register';
import UserHomePage from './pages/UserHomePage';  // Import UserHomePage
import ProtectedRoute from './components/ProtectedRoute';  // ProtectedRoute for login-check
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/user-home" element={<ProtectedRoute element={<UserHomePage />} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
